import axios from 'axios';

const AllProjects = (username, password) => {
    axios.post('http://localhost:5000/projects', {
        "username": username,
        "password": password,
    })
    .then(function (response) {
        console.log(response);
    })
    .catch(function (error) {
        console.log(error);
    });
}

export default AllProjects
